  var ecwallDefaultTable = {
    init:function(containerid,data){
      var table = $('<table>');
      var headerData = data.cols;
      var bodyData = data.rows;
      var formatObj = this.formater(headerData);
      var thead = this.initHeader(headerData);
      var tbody = this.initBody(bodyData,formatObj);
      table.append(thead).append(tbody);
      $('#'+containerid).append(table);
    },
    initHeader:function (headerData) {
      var thead = $('<thead>');
      var tr = $('<tr>');
      for(var i=0,iMax=headerData.length;i<iMax;i++){
        var headerItem = headerData[i];
        var td = $('<td>');
        td.html(headerItem.label);
        td.attr('gaid',headerItem.id);
        td.attr('gatype',headerItem.type);
        tr.append(td);
      }
      thead.append(tr);
      return thead;
    },
    initBody:function(bodyData,formatObj){
      var me = this;
      var tbody = $('<tbody>');
      for(var i=0,iMax=bodyData.length;i<iMax;i++){
        var tr = $('<tr>');
        var trData = bodyData[i].c;
        for(var j=0,jMax=trData.length;j<jMax;j++){
          var tdData = trData[j];
          var td = $('<td>');
          var tdValue = tdData.v;
          if(formatObj[j.toString()]) tdValue = formatObj[j.toString()](tdValue);
          td.html(tdValue);
          tr.append(td);
        }
        tbody.append(tr);
      }
      return tbody;
    },
    formatSet:{
      'ga:date':function(val){
        return val.substr(0,10);
      }
    },
    formater:function(headerData){
      var formatObj = {};
      for(var i=0,iMax=headerData.length;i<iMax;i++){
        var headerItem = headerData[i];
        if(this.formatSet[headerItem.id]){
          formatObj[i.toString()] = this.formatSet[headerItem.id];
        }
      }
      return formatObj;
    }
  }
</script>
